/** 
 * Checks if the suffix of strings.get(i) matches the suffix of this matcher. The first prefix.length characters of s are ignored. This method is useful if you've already independently verified the prefix. This method evalutes strings.get(i) lazily to save time when it isn't necessary to actually look at the string.
 */
public boolean matchesSuffixOnly(final Indexed<String> strings,final int i){
  if (suffixMatch == SuffixMatch.MATCH_ANY) {
    return true;
  }
 else   if (suffixMatch == SuffixMatch.MATCH_EMPTY) {
    final String s=strings.get(i);
    return s == null ? matches(null) : s.length() == prefix.length();
  }
 else {
    final String s=strings.get(i);
    return matches(s);
  }
}
